import Category from './Category'
import TopSelling from './TopSelling'
import New from './New'
export default function index() {
  return (
    <div className="ui fixed menu" style={{margin:'auto', paddingTop:'100px'}}>
      <TopSelling />
      <New />
      <Category />
    </div>
  )
}
